    false,nt"url": null,nt"notes": "These data depict the occurrence of submarine
    cables in and around U.S. navigable waters. The geographic extent of these data
    is greater than the "NASCA Submarine Cables" dataset. The purpose of these data
    products are to support coastal planning at the regional and national scale. These
    data are derived from 2010 NOAA Electronic Navigational Charts (ENCs) and 2009 NOAA
    Raster Navigational Charts (RNCs). Abandoned cables, or cables that have been removed
    may appear within this data set. Features defined as cables were compiled from the
    original sources, exclusive of those features noted as 'cable areas'.",nt"owner_org":
